//[阵法]替补属性品质刷新package cn.mxz;public class FormationBenchSpetTemplet {	/** 	 * 替补位品质 	 */	private int spet;	/** 	 * 权重 	 */	private int weight;	/** 	 * 说明 	 */	private String explain;	/** 	 * 必出刷新数量（-1不考虑,如果必出的出现了对应的数据刷新） 	 */	private int mustNumber;	/**	 * 替补位品质	 */	void setSpet(int spet) {		this.spet = spet;	}	/**	 * 替补位品质	 */	public int getSpet() {		return this.spet;	}	/**	 * 权重	 */	void setWeight(int weight) {		this.weight = weight;	}	/**	 * 权重	 */	public int getWeight() {		return this.weight;	}	/**	 * 说明	 */	void setExplain(String explain) {		this.explain = explain;	}	/**	 * 说明	 */	public String getExplain() {		return this.explain;	}	/**	 * 必出刷新数量（-1不考虑,如果必出的出现了对应的数据刷新）	 */	void setMustNumber(int mustNumber) {		this.mustNumber = mustNumber;	}	/**	 * 必出刷新数量（-1不考虑,如果必出的出现了对应的数据刷新）	 */	public int getMustNumber() {		return this.mustNumber;	}}